import React, { useEffect, useState } from 'react';
import api from '../services/api';

function AdminPanel() {
    const [users, setUsers] = useState([]);
    const [courses, setCourses] = useState([]);
    const [articles, setArticles] = useState([]);
    const [subscriptions, setSubscriptions] = useState([]);
    const [subscriptionTypes, setSubscriptionTypes] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    const [newUser, setNewUser] = useState({ name: '', email: '', is_active: true });
    const [newCourse, setNewCourse] = useState({
        title: '',
        description: '',
        price: '',
        is_active: false,
        is_subscription_based: false,
    });
    const [newArticle, setNewArticle] = useState({ title: '', content: '', course_id: '' });
    const [newSubscription, setNewSubscription] = useState({
        user_id: '',
        subscription_type_id: '',
        start_date: '',
        end_date: '',
        status: 'Active',
    });

    useEffect(() => {
        const fetchData = async () => {
            try {
                const [usersRes, coursesRes, articlesRes, subscriptionsRes, subscriptionTypesRes] =
                    await Promise.all([
                        api.get('/usercus'),
                        api.get('/courses'),
                        api.get('/articles'),
                        api.get('/subscriptions'),
                        api.get('/subscription-types'),
                    ]);
                setUsers(usersRes.data);
                setCourses(coursesRes.data);
                setArticles(articlesRes.data);
                setSubscriptions(subscriptionsRes.data);
                setSubscriptionTypes(subscriptionTypesRes.data);
            } catch (err) {
                setError('Failed to load admin data');
            } finally {
                setLoading(false);
            }
        };

        fetchData();
    }, []);

    // CRUD Handlers
    const handleCreateSubscription = async () => {
        try {
            const response = await api.post('/subscriptions', newSubscription);
            setSubscriptions([...subscriptions, response.data]);
            setNewSubscription({
                user_id: '',
                subscription_type_id: '',
                start_date: '',
                end_date: '',
                status: 'Active',
            });
        } catch (err) {
            alert('Failed to create subscription');
        }
    };

    const handleDeleteSubscription = async (id) => {
        try {
            await api.delete(`/subscriptions/${id}`);
            setSubscriptions(subscriptions.filter((sub) => sub.id !== id));
        } catch (err) {
            alert('Failed to delete subscription');
        }
    };

    if (loading) {
        return <div>Loading admin panel...</div>;
    }

    if (error) {
        return <div>Error: {error}</div>;
    }

    return (
        <div>
            <h1>Admin Panel</h1>

            {/* Subscriptions Section */}
            <h2>Subscriptions</h2>
            <form
                onSubmit={(e) => {
                    e.preventDefault();
                    handleCreateSubscription();
                }}
            >
                <label>
                    User:
                    <select
                        value={newSubscription.user_id}
                        onChange={(e) =>
                            setNewSubscription({ ...newSubscription, user_id: e.target.value })
                        }
                        required
                    >
                        <option value="">Select a user</option>
                        {users.map((user) => (
                            <option key={user.id} value={user.id}>
                                {user.name}
                            </option>
                        ))}
                    </select>
                </label>
                <br />
                <label>
                    Subscription Type:
                    <select
                        value={newSubscription.subscription_type_id}
                        onChange={(e) =>
                            setNewSubscription({
                                ...newSubscription,
                                subscription_type_id: e.target.value,
                            })
                        }
                        required
                    >
                        <option value="">Select a subscription type</option>
                        {subscriptionTypes.map((type) => (
                            <option key={type.id} value={type.id}>
                                {type.name}
                            </option>
                        ))}
                    </select>
                </label>
                <br />
                <label>
                    Start Date:
                    <input
                        type="date"
                        value={newSubscription.start_date}
                        onChange={(e) =>
                            setNewSubscription({ ...newSubscription, start_date: e.target.value })
                        }
                        required
                    />
                </label>
                <br />
                <label>
                    End Date:
                    <input
                        type="date"
                        value={newSubscription.end_date}
                        onChange={(e) =>
                            setNewSubscription({ ...newSubscription, end_date: e.target.value })
                        }
                        required
                    />
                </label>
                <br />
                <label>
                    Status:
                    <select
                        value={newSubscription.status}
                        onChange={(e) =>
                            setNewSubscription({ ...newSubscription, status: e.target.value })
                        }
                        required
                    >
                        <option value="Active">Active</option>
                        <option value="Paused">Paused</option>
                        <option value="Expired">Expired</option>
                    </select>
                </label>
                <br />
                <button type="submit">Add Subscription</button>
            </form>
            <ul>
                {subscriptions.map((sub) => (
                    <li key={sub.id}>
                        User: {users.find((u) => u.id === sub.user_id)?.name}, Type:{' '}
                        {subscriptionTypes.find((type) => type.id === sub.subscription_type_id)?.name},{' '}
                        Status: {sub.status}
                        <button onClick={() => handleDeleteSubscription(sub.id)}>Delete</button>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default AdminPanel;
